import React, { Component } from 'react'
import '../css/Head.css'

class Head extends Component {
  render() {
    return (
      <div className="head-container">
        <div className="start">
          <a
            href="#"
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('home')
            }.bind(this)}
          >
            Home
          </a>

          <p>mode : {this.props.mode}</p>
        </div>
        <div className="middle">search</div>
        <div className="end">
          <a
            href="#"
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('home')
            }.bind(this)}
          >
            Home
          </a>
          <a
            href="#"
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('create')
            }.bind(this)}
          >
            create
          </a>
        </div>
      </div>
    )
  }
}

export default Head
